export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},sjNGTJMTv6:{data:{id:1506,attributes:{imdbId:"tt0120703",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZjhlNzMxZDEtYmFjNy00ZjM5LWE1YmQtOTM1YTFmMTIxZGZiXkEyXkFqcGdeQXVyMTMxMTY0OTQ@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"5.7\u002F10"},{Source:"Rotten Tomatoes",Value:"50%"},{Source:"Metacritic",Value:"56\u002F100"}],item_lang:{data:{id:2169,attributes:{title:d,plot:"Stella Payne (Angela Bassett) is a highly successful, forty-something San Francisco, California stock broker who is persuaded by her colorful New York City girlfriend Delilah Abraham (Whoopi Goldberg) to take a well deserved, first-class vacation to Jamaica. As she soaks in the beauty of the island, she encounters a strapping, young islander, Winston Shakespeare (Taye Diggs). His pursuits for her turn into a hot and steamy romance that forces Stella to take personal inventory of her life and try to find a balance between her desire for love and companionship, and the responsibilities of mother and corporate executive.",slug:"how-stella-got-her-groove-back"}}},books:{data:[{id:7925,attributes:{title:d,description:i,thumbnail:j,authors:[a],firstBook:true,published:k,publisher:l,subtitle:m}},{id:7926,attributes:{title:d,description:i,thumbnail:j,authors:[a],firstBook:c,published:k,publisher:l,subtitle:m}},{id:7927,attributes:{title:n,description:o,thumbnail:p,authors:[a],firstBook:c,published:q,publisher:e,subtitle:f}},{id:7928,attributes:{title:n,description:o,thumbnail:p,authors:[a],firstBook:c,published:q,publisher:e,subtitle:f}},{id:7929,attributes:{title:"It's Not All Downhill From Here",description:"NEW YORK TIMES BESTSELLER • After a sudden change of plans, a remarkable woman and her loyal group of friends try to figure out what she’s going to do with the rest of her life—from Terry McMillan, the bestselling author of How Stella Got Her Groove Back and Waiting to Exhale NAMED ONE OF THE BEST BOOKS OF THE YEAR BY MARIE CLAIRE AND GOOD HOUSEKEEPING • “Poignant, funny and full of life, this is a balm for troubled times.”—People Loretha Curry’s life is full. A little crowded sometimes, but full indeed. On the eve of her sixty-eighth birthday, she has a booming beauty-supply empire, a gaggle of lifelong friends, and a husband whose moves still surprise. True, she’s carrying a few more pounds than she should be, but Loretha is not one of those women who think her best days are behind her—and she’s determined to prove wrong her mother, her twin sister, and everyone else with that outdated view of aging wrong. It’s not all downhill from here. But when an unexpected loss turns her world upside down, Loretha will have to summon all her strength, resourcefulness, and determination to keep on thriving, pursue joy, heal old wounds, and chart new paths. With a little help from her friends, of course.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=McmfDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2020-03-31",publisher:e,subtitle:f}}]}}},meta:{}}},prerenderedAt:1681377326559}}("Terry McMillan","movie",null,"How Stella Got Her Groove Back","Ballantine Books","A Novel","series",1,"Presents a humorous novel about a woman who unexpectedly finds love but who just might be losing her mind.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=xZRQeH2DouQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2004-01-01","Penguin","","I Almost Forgot About You","NEW YORK TIMES BESTSELLER • The bestselling author of How Stella Got Her Groove Back and Waiting To Exhale is back with the inspiring story of a woman who shakes things up in her life to find greater meaning NAMED ONE OF THE BEST BOOKS OF THE YEAR BY LIBRARY JOURNAL In I Almost Forgot About You, Dr. Georgia Young's wonderful life—great friends, family, and successful career—aren't enough to keep her from feeling stuck and restless. When she decides to make some major changes in her life, including quitting her job as an optometrist and moving house, she finds herself on a wild journey that may or may not include a second chance at love. Georgia’s bravery reminds us that it’s never too late to become the person you want to be, and that taking chances, with your life and your heart, are always worthwhile. Big-hearted, genuine, and universal, I Almost Forgot About You shows what can happen when you face your fears, take a chance, and open yourself up to life, love, and the possibility of a new direction. It’s everything you’ve always loved about Terry McMillan. Praise for I Almost Forgot About You “McMillan paints relationships in joyous primary colors; her novel brims with sexy repartee, caustic humor, and a fluent, assured prose that shines a bright light on her memorable characters. Her very best since Waiting to Exhale.”—O: The Oprah Magazine “The novel is immensely companionable, and Georgia is as alive, complex, inquiring, motivated and sexy as any twenty-five-year-old. Maybe more so.”—The New York Times Book Review “Self-discovery, second chances and the importance of family are thematic hallmarks of McMillan’s novels. . . . I Almost Forgot About You checks all the boxes.”—Washington Post “McMillan is funny and frank about men, women and sex. Her summaries of Georgia’s marriages and major love connections . . . are powerful and poetic.”—USA Today “Reading a Terry McMillan book feels like catching up with an old friend. . . . I Almost Forgot About You is a book that is important for readers of every age.”—Ebony","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=O9yKCgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2016-06-07"))